import React from 'react';

import { BrowserRounter, Switch, Route } from 'react-router-dom';

import Main from  './pages/main'

const Routes = () => (

    <BrowserRounter>
        <Switch>
            <Route path="/" component={Main} />
        </Switch>
    </BrowserRounter>
)

export default Routes;
